export default function Navbar() {
  return (
    <nav className="fixed top-0 w-full bg-darkBlue bg-opacity-90 backdrop-blur-md shadow z-50">
      <div className="max-w-6xl mx-auto flex justify-between items-center py-4 px-6">
        <h1 className="text-2xl font-bold text-purpleAccent cursor-target">MyPortfolio</h1>

        <ul className="hidden md:flex space-x-8 text-gray-300">
          <li><a href="#hero" className="hover:text-purpleAccent cursor-target">Home</a></li>
          <li><a href="#about" className="hover:text-purpleAccent cursor-target">About</a></li>
          <li><a href="#projects" className="hover:text-purpleAccent cursor-target">Projects</a></li>
          <li><a href="#chatbot" className="hover:text-purpleAccent cursor-target">Chatbot</a></li>
          <li><a href="#footer" className="hover:text-purpleAccent cursor-target">Contact</a></li>
        </ul>
      </div>
    </nav>
  );
}
